import './cotcstyle.css';

const whichpage = "none";


	
	
    

const audio = document.getElementById("hoversound");

function hoverr(){	
	console.log('seen');
     audio.play();
	
};


function Film() {
	
	let navigate = useNavigate();
	
	
    
	
	
	const home = function () {navigate('/');};
	
	
  return (
  <body className="site">
<div className="bgmood">
    
	
	<audio id = "hoversound" src ={hover}></audio>
	<div className="div1" onmouseover="hoverr()" onClick={home}> <h1 className="bgtext">Home</h1> </div>
	<div className="div1"  > <h1 className="bgtext">Upcoming projects</h1> 
<p className="bgtext">Big N Hungry (TBA) : script in development</p>	</div>
	
	</div>
	
	
	
	
	</body>
	
  );
}

export default Film;
